import React from "react";
import "./Navbar.css";

export default function Navbar() {
  return (
    <nav className="navbar navbar-dark bg-black">
      <section className="container-fluid justify-content-center">
        <Link to={"/"}>MIRRONAKE</Link>
      </section>
    </nav>
  );
}
